{
  printf("Tracing Resource Limits... Hit Ctrl-C to end.\n");
}

tracepoint:syscalls:sys_enter_setrlimit
{
  $rlim = (struct rlimit *)arg1;
  printf("%s(%d) set resource limit: cur=%lu, max=%lu\n", comm, pid, $rlim->rlim_cur, $rlim->rlim_max);
}

tracepoint:syscalls:sys_enter_getrlimit
{
  $rlim = (struct rlimit *)arg1;
  printf("%s(%d) get resource limit: cur=%lu, max=%lu\n", comm, pid, $rlim->rlim_cur, $rlim->rlim_max);
}

tracepoint:syscalls:sys_exit_brk
/arg1 > 0/
{
  printf("%s(%d) exceeded memory limit: requested=%lu\n", comm, pid, arg1);
}

tracepoint:syscalls:sys_exit_open
/arg1 < 0/
{
  printf("%s(%d) exceeded file descriptor limit: fd=%d\n", comm, pid, arg1);
}

